import React from 'react';
import Head from 'next/head';

const Profile = () => {
    return (
        <>
            <Head>
                <title>My Profile | Nodebird</title>
            </Head>
            <AppLayout>My Profile</AppLayout>
        </>
    )
};

export default Profile;
